def is_interleave(s1, s2, s3):
    m, n = len(s1), len(s2)

    # Length check
    if m + n != len(s3):
        return False

    # Initialize the DP table
    dp = [[False] * (n + 1) for _ in range(m + 1)]

    # Base case
    dp[0][0] = True

    # Fill the DP table
    for i in range(m + 1):
        for j in range(n + 1):
            if i > 0 and s1[i - 1] == s3[i + j - 1]:
                dp[i][j] = dp[i][j] or dp[i - 1][j]
            if j > 0 and s2[j - 1] == s3[i + j - 1]:
                dp[i][j] = dp[i][j] or dp[i][j - 1]

    return dp[m][n]
