def search(nums, target):
    left, right = 0, len(nums) - 1

    while left <= right:
        mid = left + (right - left) // 2

        if nums[mid] == target:
            return True

        # Handle duplicates
        if nums[mid] == nums[left]:  
            left += 1
        elif nums[mid] > nums[left]:  
            if nums[left] <= target < nums[mid]:  
                right = mid - 1
            else:
                left = mid + 1
        else:  # nums[mid] < nums[left]
            if nums[mid] < target <= nums[right]:  
                left = mid + 1
            else:
                right = mid - 1

    return False
