def exist(board, word):
    if not board or not board[0]:
        return False

    rows, cols = len(board), len(board[0])

    def dfs(i, j, k):
        if i < 0 or i >= rows or j < 0 or j >= cols or board[i][j] != word[k]:
            return False
        if k == len(word) - 1:
            return True

        temp = board[i][j]
        board[i][j] = '#'

        found = (dfs(i + 1, j, k + 1) or 
                 dfs(i - 1, j, k + 1) or 
                 dfs(i, j + 1, k + 1) or 
                 dfs(i, j - 1, k + 1))

        board[i][j] = temp

        return found

    for i in range(rows):
        for j in range(cols):
            if board[i][j] == word[0] and dfs(i, j, 0):
                return True

    return False
