        return

    m, n = len(matrix), len(matrix[0])
    first_row_zero = False
    first_col_zero = False

    # First Pass: Mark the first row and column.
    for i in range(m):
        for j in range(n):
            if matrix[i][j] == 0:
                if i == 0:
                    first_row_zero = True
                if j == 0:
                    first_col_zero = True
                matrix[i][0] = 0
                matrix[0][j] = 0

