def simplify_path(path: str) -> str:
    parts = path.split('/')
    stack = []

    for part in parts:
        if part == "" or part == ".":
            continue
        elif part == "..":
            if stack:
                stack.pop()  # Move up one directory
        else:
            stack.append(part)  # Add valid directory name

    # Join stack into canonical path
    canonical_path = '/' + '/'.join(stack)

    return canonical_path
