def totalNQueens(n):
    def is_safe(col, row):
        for i in range(col):
            if cols[i] == row or abs(cols[i] - row) == abs(i - col):
                return False
        return True

    def backtrack(col):
        if col == n:
            nonlocal count
            count += 1
            return
        for row in range(n):
            if is_safe(col, row):
                cols[col] = row
                backtrack(col + 1)
                cols[col] = -1

    cols = [-1] * n
    count = 0
    backtrack(0)
    return count
