def binary_search_insert_position(nums, target):
    left, right = 0, len(nums) - 1

    while left <= right:
        mid = (left + right) // 2

        if nums[mid] == target:
            return mid  # Target found at mid index.
        elif nums[mid] < target:
            left = mid + 1  # Move to the right half.
