def threeSumClosest(nums, target):
    nums.sort()
    closest = sum(nums[:3])

    n = len(nums)
    for i in range(n - 2):
        left, right = i + 1, n - 1
        while left < right:
            cur_sum = nums[i] + nums[left] + nums[right]

            if cur_sum == target:
                return cur_sum

            if abs(cur_sum - target) < abs(closest - target):
                closest = cur_sum

            if cur_sum < target:
                left += 1
            else:
                right -= 1

    return closest
```

