    m, n = len(s), len(p)
    dp = [[False] * (n + 1) for _ in range(m + 1)]

    dp[0][0] = True

    for j in range(1, n + 1):
        if p[j - 1] == '*':
            dp[0][j] = dp[0][j - 2]

    for i in range(1, m + 1):
        for j in range(1, n + 1):
            if s[i - 1] == p[j - 1] or p[j - 1] == '.':
                dp[i][j] = dp[i - 1][j - 1]
            elif p[j - 1] == '*':
                dp[i][j] = dp[i][j - 2] or (dp[i - 1][j] and (s[i - 1] == p[j - 2] or p[j - 2] == '.'))

    return dp[m][n]
```

```python
def zigzag_conversion(s: str, num_rows: int) -> str:
    if num_rows == 1 or num_rows >= len(s):
        return s

    rows = [''] * num_rows
    current_row = 0
    going_down = False

    for char in s:
        rows[current_row] += char
        if current_row == 0:
            going_down = True
        elif current_row == num_rows - 1:
            going_down = False

        current_row += 1 if going_down else -1

    return ''.join(rows)

# Sample test cases
print(zigzag_conversion("PAYPALISHIRING", 3))  # Expected output: "PAHNAPLSIIGYIR"
print(zigzag_conversion("A", 1))               # Expected output: "A"
print(zigzag_conversion("", 2))                 # Expected output: ""
```

